import {  useSelector } from 'react-redux';
import { getMachineConfig } from 'store/machine/machine.selectors';
import Table from 'components/Table';


const Tile = ()=> {
  const machineConfig = useSelector(getMachineConfig);

  return (
<Table data={machineConfig}/>
  );
}

export default Tile;
